        <meta name="viewport" content="width=device-width, initial-scale=1"> 
        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-2098324020":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"0","jsonContent":"{\"content\":[{\"content\":{\"params\":{\"text\":\"<p><strong><span style=\\\"font-size:1.25em\\\"><span style=\\\"color:#3498db\\\">Koordinatensystem einer CNC-Maschine</span></span></strong></p>\\n\\n<p> </p>\\n\\n<p>Punkte im Arbeitsraum einer CNC-Maschine können mit <strong>Koordinaten </strong>definiert werden. In der Norm DIN 66 217 werden die \\\"Achsbezeichnungen und ihre Zuiodnung zu einem Koordinatensystem\\\" [1] festgelegt. Bei der Festlegung der Koordinatensysteme wird von dem Werkstück ausgegangen, das auf der Maschine aufgespannt ist. Es werden folgende Festlegungen getriffeb;</p>\\n\\n<p><strong>Z-Achse</strong></p>\\n\\n<p>Die Z-Achse verläuft in Richtung der Arbeitsspindel. Es erfolgt eine Bewegung in positiver Richtung, wenn der Abstand zwischen Werkstück und Werkzeug größer wird. Bei einer Bewegung in negativer Richtung verkleinert sich dieser Abstand.</p>\\n\\n<p><strong>X-Achse</strong></p>\\n\\n<p>Die Y-Achse liegt in Richtung der Aufspannfläche des Werkstücks. </p>\\n\\n<p><strong>Y-Achse</strong></p>\\n\\n<p>Die Y-Achse verläuft senkrecht zur X- und z-Achse. </p>\\n\\n<p>Aus den 3 Achsen ergibt sich ein räumliches Koordinatensystem. Als Hilfestellung für die Koordinatenbezeichnung kann sich auf die \\\"Rechte-Hand-Regel\\\" bezogen werden. Der Daumen steht für die X-Achse, der Zeigefinger für die Y-Achse und der Mittelfinger für die z-Achse.</p>\\n\\n<p>[Vgl. 1]</p>\\n\\n<p>[1] https://www.lehrerfreund.de/technik/1s/werkzeugmaschinen-fraesmaschine/4772, abgerufen am 31.05.22</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"01eabf9f-e480
